// SearchResultsPage.js
import React from "react";
import { useNavigate, useSearchParams } from "react-router-dom";
import "./styles/SearchResultsPage.css";

function SearchResultsPage() {
  const navigate = useNavigate();

  const [searchParams] = useSearchParams();
  
  // Retrieve the "query" parameter (fallback to empty string if not present)
  const query = searchParams.get("query") || "";

  // Dummy data for now
  const dummyResults = [
    {
      name: "J. Stevens (dummy profile)",
      summary:
        "J. Stevens has Salesforce Development as a technical expertise and 2 projects that include Salesforce."
    }
    // You can add more items here
  ];

  // Handlers
  const handleSearchAgain = () => {
    // Navigate back to /search (or wherever your SearchPage is)
    navigate("/search");
  };

  const handleViewProfile = () => {
    // For now, just log or alert. Later, you can navigate to a profile detail page
    alert("View Profile clicked!");
  };

  return (
    <div className="results-container">
      <div className="results-header">
        <button className="search-again-button" onClick={handleSearchAgain}>
          Search Again <span className="search-icon">üîç</span>
        </button>
        <h2 className="searchr-title">Search Profiles</h2>
      </div>

      {/* Optional subheading */}
      <p className="search-query">Results for: "{query}"</p>

      {/* Results List */}
      <ul className="results-list">
        {dummyResults.map((result, index) => (
          <li key={index} className="result-item">
            <div className="result-info">
              {/* A placeholder icon for a user */}
              <span className="profile-icon">üë§</span>
              <div>
                <div className="result-name">{result.name}</div>
                <div className="result-summary">{result.summary}</div>
              </div>
            </div>
            <div>
            <button className="view-profile-button" onClick={handleViewProfile}>
              View Profile <span className="arrow">‚Üí</span>
            </button>
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default SearchResultsPage;
